import React, { Component } from "react";

export default class Credit extends Component {
  render() {
    const style = {
      fontSize: "40px",
      marginTop: "200px"
    };
    const imageStyle = {
      height: "300px"
    };
    return (
      <div style={style}>
        <span>
          <h1>No Limits for Deaf Children (Documentary)</h1>
        </span>
        <span>
          <img style={imageStyle} src={require("../images/bluehour.png")} />
        </span>
        <h1>Blue Hour (Short Film)</h1>
        <h1>All Summer in a Day (Short Film)</h1>
        <h1>Killer Kids (A&E)</h1>
        <h1>Night Watch (A&E)</h1>
        <h1>Pitbulls and Parolles (Animal Planet)</h1>
        <h1>Curse of Oak Island (History Channel)</h1>
        <h1>Mother of All Lies (Lifetime)</h1>
      </div>
    );
  }
}
